// src/components/Skills.js
import React from 'react';
import './style1.css'; // Import your styles if needed

const Skills = () => {
  return (
    <div>
      <section className="header">
        <img src="./images/indexbanner.jpg" className="back-video" alt="Header Background" />
        <nav>
          {/* ... (your navigation code) ... */}
        </nav>
        <div className="skills hidden">
          <h9>Skills</h9>
        </div>
      </section>

      {/* Add your skills and other content specific to the Skills page */}
    </div>
  );
};

export default Skills;
